import React from "react";
import { Box, Grid } from "@material-ui/core";

const Prueba = () => {
    return (
        <>
          {created && <Navigate to="/ " />}
          <div className="createUserContent">
        
    
              <Item text="Nombre del proyecto" />
              
          </div>
        </>
    );
};

export default Prueba;
